script: |
  super -f text -I q3769.spq | sort > q3769.out

inputs:
  - name: q3769.spq
    data: |
      SELECT DISTINCT - - col0 AS col0 FROM tab0 (FORMAT parquet) WHERE NOT + - col0 IN ( - + col0 * - col1 + - 59 + - + col0, ( - + 21 ) + + col1 );
  - name: tab0

outputs:
  - name: q3769.out
    data: |
      15
      87
      97
